import  React ,{ Component } from 'react';

class HeaderRight extends Component {
    render () {
        return (
            <div className="right">
                <ul className="share">
                    <li className="facebook"></li>
                    <li className="twitter"></li>
                    <li className="google-plus"></li>
                </ul>
                <div className="action">
                    <a>Back</a>
                    <a >Download</a>
                </div>
            </div>
        )
    }
}

export default HeaderRight;
